// src/App.js
import React from 'react';
import HabitTracker from './components/HabitTracker';
import TaskView from './components/TaskView'; // Import TaskView
import MainCalendar from './components/CalendarContext'; // Import MainCalendar
import { CalendarProvider } from './components/calendar'; // Import CalendarProvider

function App() {
    return (
        <CalendarProvider>
            <div className="App">
                <MainCalendar /> {/* Render MainCalendar for date navigation */}
                <HabitTracker />
                <TaskView /> {/* Render TaskView */}
            </div>
        </CalendarProvider>
    );
}

export default App;
